import { color, font, greenGradient, greenBackground } from '../../layout/main';
import uuid from 'uuid/v1';
import Title from './title';

const Gallery = () => {

  return(
    <div className="main">
      <div className="cont shadow">

      </div>
      <style jsx>{`
        .main{
          height: 100%;
          display: flex;
          justify-content: center;
          align-items: center;
        }
        .cont{
          width: 80%;
          height: 70%;
          background: transparent;
        }
      `}
      </style>
    </div>
  )
}

const Main = ()=> {

  return(
    <div className="main">
      <Title word="top greenpost's" />
      <Gallery />
      <style jsx>{`
        .main{
          ${greenBackground()};
          height: 100vh;
          display: flex;
          flex-direction: column;
        }
      `}
      </style>
    </div>
  )
}


export default Main;
